Bundles start with a fixed header indicating among other things what appears to be the uncompressed(?) bundle size and the total size of payloads in the bundle. There's a list of absolute sizes for entries in the file, whose length sum up to the total payload size. A work-in-progress 010 Editor template for the file: uint32 uncompressed_size;
uint32 total_payload_size;
uint32 unk08[3];
uint32 uncompressed_size2;
uint32 unk18;
uint32 total_payload_size2;
uint32 unk20;
uint32 entry_count;
uint32 unk28[5];
uint32 entry_sizes[entry_count]; local int i <hidden=true>;
for (i = 0; i < entry_count; ++i) { struct entry_t { byte data[entry_sizes[i]]; } entry;
} File entries seem to as far as have been observed start with the octets 8C 0C or 8C 06, with some slivers of plaintext like "DDS " occurring in the payload but with bogus values for fields, hinting at some sort of compression.

