The tail has two mapped versions, version 2 and version 3 and a largely unknown version 4. The blocks in version 2 seem to be a subset of the blocks in version 3. Both versions have some counts up-front and blocks of varying sizes with that many elements, with the following data types: uint32 tail_version; typedef struct { float f0[15]; uint32 u60;
} tail_0_t; typedef struct { float f0[4]; uint32 u16;
} tail_1_t; typedef struct { uint32 u0, u4;
} tail_2_t; // tail_3_t is unknown, never occured in files typedef struct { float vec0[3]; uint32 index12[4]; float weight28[4];
} tail_4_t; typedef uint32 tail_5_t;
typedef uint32 tail_6_t; if (tail_version == 3) { uint32 tail_counts[7]; if (tail_counts[0] > 0) { tail_0_t sec0[tail_counts[0]]; } if (tail_counts[1] > 0) { tail_1_t sec1[tail_counts[1]]; } if (tail_counts[2] > 0) { tail_2_t sec2[tail_counts[2]]; } // tail_counts[3] is always zero in all files, type unknown if (tail_counts[4] > 0) { tail_4_t sec4[tail_counts[4]]; } // Sections 5 and 6 are both u32:s, might be swapped if (tail_counts[5] > 0) { tail_5_t sec5[tail_counts[5]]; } if (tail_counts[6] > 0) { tail_6_t sec6[tail_counts[6]]; }
} Note that version 2 has the blocks in a strange order, both count-wise and compared to version 3. It is possible that the mapping from v2 to v3 blocks I've made is not accurate, as the two u32-type blocks are hard to tell apart. if (tail_version == 2) { uint32 tail_counts[4]; if (tail_counts[1] > 0) { tail_4_t sec4[tail_counts[1]]; } if (tail_counts[2] > 0) { tail_5_t sec1[tail_counts[2]]; } if (tail_counts[0] > 0) { tail_0_t sec0[tail_counts[0]]; } if (tail_counts[3] > 0) { tail_6_t sec3[tail_counts[3]]; }
